import React, { Component } from "react";

class TableBody extends Component {
  render() {
    const { data, columns } = this.props;
    return (
      <div>
        <tbody>
          {this.data.map(
            <tr>
              {this.columns.map((item) => (
                <td>{}</td>
              ))}
            </tr>
          )}
        </tbody>
      </div>
    );
  }
}

export default TableBody;
